/**
 *
 * Navigation.js
 * @author Peter Laxalt
 * @description The website Navigation.
 *
 */

// Core
import React from "react";
import Link from "next/link";

// Styles
import { NavigationStyle } from "./styles.scss";

// Begin Component
//////////////////////////////////////////////////////////////////////

export const Navigation = () => (
  <NavigationStyle>
    <Link href="/">
      <a>Home</a>
    </Link>{" "}
    |
    <Link href="/about">
      <a>About</a>
    </Link>{" "}
    |
    <Link href="/contact">
      <a>Contact</a>
    </Link>
  </NavigationStyle>
);

// End Component
